%%

% --- 1. Define Parameters ---
M_w = 0.5;   % Mass of one wheel
M_r = 1.0;   % Mass of robot body
m_b = 0.02;  % Mass of the ball
R = 0.05;    % Radius of the wheel
h = 0.1;     % Height of robot CoM from ball platform
r = 0.002;   % Radius of the ball
g = 9.81;    % Gravity
d = 0.03; 

% --- 2. Moments of Inertia ---
I_w = 0.5 * M_w * R^2;        % Inertia of one wheel (Note: Not used in M1, M2, M3)
I_r_com = (1/12) * M_r * (h^2 + d^2);       % body about its own COM
I_r = I_r_com + M_r * d^2;              % Inertia of robot body (parallel axis theorem)
I_b = 0.4 * m_b * r^2;      % Inertia of a solid sphere ball

% --- 3. Derived Parameters ---
l = h + r; % Height of ball CoM from wheel center

% --- 4. Define Matrices ---
% M1 = [[(I_b/(r^2))+m_b , -m_b*l],
%       [-m_b*l,            I_r+m_b*(l^2)]]
M1 = [(I_b/(r^2)) + m_b, -m_b*l;
      -m_b*l,            I_r + m_b*(l^2)];

% M2 = [[1,  1+(g*m_b)],
%       [1-(m_b*g), 1 - (M_r*d*g)-(m_b*g*l)]]
M2 = [1,             1 + (g*m_b);
      1 - (m_b*g), 1 - (M_r*d*g) - (m_b*g*l)];

% M3 = [[m_b*l],
%       [-m_b]]
M3 = [m_b*l;
      -m_b];

% --- 5. Calculate A and B ---
% This is the numerically preferred method for A = inv(M1) * M2
A1 = M1 \ M2;

% This is the numerically preferred method for B = inv(M1) * M3
B1 = M1 \ M3;
%%

A = [0 1 0 0;... %[output:group:229a734b] %[output:60988226]
    A1(1,1) 0 A1(1,2) 0;... %[output:60988226]
    0 0 0 1;... %[output:60988226]
    A1(2,1) 0 A1(2,2) 0] %[output:group:229a734b] %[output:60988226]
B = -[0 ; B1(1); 0 ; B1(2)] %[output:06e878d2]
C = eye(4) %[output:717ff987]
D = zeros(4,1) %[output:052d9a1f]
%%
[num,den] = ss2tf(A,B,C,D) %[output:17d34675] %[output:9a8921cb]
%%
% --- 2. Create the individual Transfer Functions (TFs) ---

% H1(s) = Y1/U (from num row 1)
H1 = tf(num(1,:), den) %[output:8546a222]

% H2(s) = Y2/U (from num row 2)
H2 = tf(num(2,:), den) %[output:2e33cd79]

% H3(s) = Y3/U (from num row 3)
H3 = tf(num(3,:), den) %[output:0f51ec1d]

% H4(s) = Y4/U (from num row 4)
H4 = tf(num(4,:), den) %[output:88dfa763]
%%
sys = ss(A, B, C, D);
%%
rank(ctrb(A,B)) %[output:07841c68]
rank(obsv(A,C)) %[output:282facca]
%%
% step input
step(sys) %[output:04413eb6]
%%
% sine input 
t = 0:0.001:5;
u = sin(2*pi*t);
lsim(sys,u,t) %[output:099a178b]
%%
% ramp input 
t = 0:0.01:10;
u = t;         
lsim(sys, u, t) %[output:76bf7d3f]
%%
% LQR controller
R = 1e-6;
%%
Q = [100 0 0 0 ; 
    0 10 0 0;
    0 0 1000 0;
    0 0 0 10];
%%
K = lqr(A, B, Q, R);
%%
% Closed-loop system
Acl = A - B*K;
sys_cl = ss(Acl, [], eye(4), []);
x0 = [0.005, 0, deg2rad(88),0] %[output:13ba49e1]
x_ref = [0.005, 0, deg2rad(90),0] %[output:256dedc6]
% Simulate response
t_sim = 0:0.01:20;
[y, t] = initial(sys_cl, x0, t_sim);

% Plot
figure; %[output:23b69e3d]
plot(t, y); %[output:23b69e3d]
xlabel('Time (s)'); %[output:23b69e3d]
ylabel('States [x, xdot, theta, thetadot]'); %[output:23b69e3d]
legend('x (ball pos)', 'xdot', 'theta', 'thetadot'); %[output:23b69e3d]
title('Closed-Loop Response of Ball balancer robot with LQR'); %[output:23b69e3d]
grid on; %[output:23b69e3d]

% Eigenvalues
disp('Closed-loop eigenvalues:'); %[output:8ddbadb8]
disp(eig(Acl)); %[output:2ae230fa]
%%
% --- Choose the state you want settling time for ---
theta = y(:,3);          % Example: body angle state
tvec = t;

% --- Settling-time function (2% criterion) ---
function Ts = settling_time(sig, tvec, tol)
    if nargin < 3
        tol = 0.02;      % 2% band
    end

    y_final = sig(end);
    band_hi = y_final*(1 + tol);
    band_lo = y_final*(1 - tol);

    % find last time where signal is *outside* the band
    idx_out = find(sig < band_lo | sig > band_hi);

    if isempty(idx_out)
        Ts = 0;          % already inside the band
    else
        Ts = tvec(idx_out(end));
    end
end
Ts_theta = settling_time(theta, tvec, 0.02);
fprintf('Settling time (theta): %.4f seconds\n', Ts_theta); %[output:07a30261]
%%
function dx = constrained_dynamics(t,x,A,B,K,x1_min,x1_max,theta_min,theta_max)

    % Apply state constraints by clipping
    x(1) = min(max(x(1), x1_min), x1_max); 
    x(3) = min(max(x(3), theta_min), theta_max);

    % Closed-loop system
    dx = (A - B*K)*x;

end

% Simulation horizon
tspan = [0 20];
x0 = [0.005; 0; deg2rad(2); 0];

% limits
x1_min = -d/2;
x1_max =  d/2;
theta_min = deg2rad(-30);
theta_max = deg2rad(30);

% ODE with constraints
f = @(t,x) constrained_dynamics(t,x,A,B,K,x1_min,x1_max,theta_min,theta_max);

[t,y] = ode45(f,tspan,x0);

% Plot results
plot(t,y) %[output:36d65a7b]
grid on %[output:36d65a7b]


